import{_ as e,o as i,c as o,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 62.1-69.32 Withdrawal; dissolution.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/62.1-69.32.md","filePath":"vacode/62.1-69.32.md"}'),a={name:"vacode/62.1-69.32.md"},s=t('<h1 id="§-62-1-69-32-withdrawal-dissolution" tabindex="-1">§ 62.1-69.32 Withdrawal; dissolution. <a class="header-anchor" href="#§-62-1-69-32-withdrawal-dissolution" aria-label="Permalink to &quot;§ 62.1-69.32 Withdrawal; dissolution.&quot;">​</a></h1><p>A. A locality may withdraw from the Commission one year after providing a written notice to the Commission of its intent to do so.</p><p>B. The Commission may dissolve itself upon a two-thirds vote of all members.</p><p>C. The Commission may be dissolved by repeal or expiration of this chapter.</p><p>D. The Commission shall be dissolved if the membership of the Commission falls below two-thirds of those eligible.</p><p>E. Upon the Commission&#39;s dissolution, all funds and assets of the Commission shall be divided on a pro rata basis. The Commonwealth&#39;s share of the funds and assets shall be transferred to the Office of the Secretary of Natural and Historic Resources for appropriate distribution.</p><p>1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0553" target="_blank" rel="noreferrer">553</a>; 2000, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0386" target="_blank" rel="noreferrer">386</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?001+ful+CHAP0456" target="_blank" rel="noreferrer">456</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0401" target="_blank" rel="noreferrer">401</a>.</p>',7),r=[s];function n(l,d,h,p,f,c){return i(),o("div",null,r)}const g=e(a,[["render",n]]);export{_ as __pageData,g as default};
